import React from 'react';
import './Contacts.css';

const Contacts = () => {
  return (
    <div className="contacts">
      <h2>Important Contacts</h2>
      <ul>
        <li>Emergency: 911</li>
        <li>Fire Department: 101</li>
        <li>Police Department: 100</li>
        <li>Medical Help: 102</li>
      </ul>
    </div>
  );
};

export default Contacts;
